            "faces.question.woman": "Hvilken f?lelse har kvinden?",
            "faces.story.determination1": "Det her er en historie om en kvinde, der blev udtaget til OL-holdet i roning. Nu k?mper hun for en guldmedalje. Halvvejs gennem l?bet ligger hun p? tredjepladsen, men hun vinder ind p? nummer to. To tredjedele gennem l?bet kan hun se, at hun er i en position, hvor hun kan passere b?den p? f?rstepladsen. Hun ror hurtigere, end hun nogensinde har gjort.",
