            "faces.story.hope1": "Det her er en historie om en mand, der tager p? v?ddel?bsbanen for at v?dde sine sidste femhundrede kroner. Han spiller det hele p? hest nummer syv. Han iagttager nu hestene i det sidste sving p? str?kningen ned mod m?llinjen. Hest nummer ni og hest nummer syv ligger meget t?t. Det ser ud til, at hest nr. syv tager f?ringen.",
            "faces.story.hope2": "Det her er en historie om en kvinde, der tager p? v?ddel?bsbanen for at v?dde femhundrede kroner. Hun spiller det hele p? hest nummer syv. Hvis hun skal vinde, skal hesten komme p? f?rste- eller andenpladsen. Hun iagttager nu hestene i det sidste sving ned mod m?llinjen. Hest nummer syv er p? andenpladsen.",
