            "faces.instructions": "Ihnen werden Fotos von Menschen mit unterschiedlichen Gesichtsausdrcken angezeigt. Whlen Sie das Wort aus, das Ihrer Meinung nach am besten beschreibt, was die Person fhlt.{break}{break}Bei einigen Fotos wird die Situation mit einer kurzen Geschichte beschrieben. In diesem Fall haben Sie {time}Sekunden Zeit zu antworten. Andere Fotos werden ohne begleitenden Text angezeigt. In diesen Fllen haben Sie 7 Sekunden Zeit fr eine Antwort. {break}Lesen Sie jede Geschichte ganz durch. Einige wirken mglicherweise sehr hnlich, doch in Wirklichkeit erzhlen sie etwas ganz anderes.",
            "faces.question.man": "Welche Emotion erlebt der Mann?",
            "faces.question.woman": "Welche Emotion erlebt die Frau?",
            "faces.story.determination1": "Dies ist die Geschichte einer Frau, die es ins olympische Ruderteam geschafft hat. Sie ist jetzt im Rennen um die Goldmedaille. Zur Hlfte des Rennens ist sie Dritte, kommt der Zweiten aber immer nher. Nach zwei Dritteln des Rennens sieht sie, dass sie in Position ist, das in Fhrung liegende Boot zu berholen. Sie rudert so schnell wie nie zuvor in ihrem Leben.",
            "faces.story.determination2": "Dies ist die Geschichte eines Mannes, der sehr hart gearbeitet und es ins olympische Ruderteam geschafft hat. Er ist jetzt im Rennen um die Goldmedaille. Zur Hlfte des Rennens liegt er in Fhrung, als erstes von fnf Booten.",
            "faces.story.hope1": "Dies ist die Geschichte eines Mannes, der zum Pferderennen geht, um mit seinen letzten 500Dollar eine Wette abzuschlieen. Er hat alles auf Pferd Nr.7 gesetzt. Jetzt sieht er die Pferde in der letzten Kurve vor der Zielgeraden. Pferd Nr.9 und Pferd Nr.7 liefern sich ein Kopf-an-Kopf-Rennen. Es sieht aus, als wrde Pferd Nr.7 die Fhrung bernehmen.",
            "faces.story.hope2": "Dies ist die Geschichte einer Frau, die zum Pferderennen geht, um eine Wette ber 500Dollar abzuschlieen. Sie hat alles auf Pferd Nr.7 gesetzt. Das Pferd muss das Rennen auf dem ersten oder zweiten Platz abschlieen, damit die Frau ihre Wette gewinnt. Jetzt sieht sie die Pferde in der letzten Kurve vor der Zielgeraden. Pferd Nr.7 liegt auf dem zweiten Platz.",
            "faces.story.pain": "Dies ist die Geschichte einer Frau, die gerade an ihrem eingewachsenen Funagel operiert wurde. Sie steht jetzt in der Warteschlange, um sich einen Film anzusehen. Als ein anderer Film zu Ende ist, wird die wartende Menge aufgefordert zurckzutreten, um die Zuschauer durchzulassen. Jemand tritt ihr versehentlich auf den Zeh.",
            "faces.story.pain2": "Dies ist die Geschichte eines Mannes, der ins Kino geht, um sich einen Film anzusehen. Er steht jetzt in der Warteschlange fr den Film. Als das Publikum in den Kinosaal hineingelassen wird, drngeln sich zwei Menschen grob durch die Menge. Dabei rempeln sie den Mann an und treten ihm auf seinen verletzten Zeh.",
            "faces.story.puzzled": 'Dies ist die Geschichte eines Mannes, der zum ersten Mal zu McDonalds geht. Whrend er in der Schlange steht, schaut er unverwandt zur Speisekarte hoch. Mehrere Leute werden bedient und noch bevor der Mann es merkt, steht er ganz vorne und ist an der Reihe. Der Kassierer fragt: Was darf es sein?" Der Mann nimmt den Kassierer zur Kenntnis und widmet sich wieder der Speisekarte.',
            "faces.story.puzzled2": 'Dies ist die Geschichte einer Frau, die zum Mittagessen zu McDonalds geht. Nach kurzem Anstehen in der Schlange ist sie an der Reihe. Der Kassierer fragt: Was darf es sein?" Die Frau nimmt den Kassierer zur Kenntnis und widmet sich wieder der Speisekarte.',
