            "stop2.instructions1": "Drcken Sie auf {leftArrow}, wenn Sie die Buchstaben A oder B sehen, und drcken Sie auf {rightArrow}, wenn Sie die Buchstaben C oder D sehen. Sie sollten die Eingaben mit Zeige- und Mittelfinger Ihrer dominanten Hand vornehmen.{break}{break}ALLERDINGS erhalten Sie bei einigen Versuchen ein STOPP-Signal {stop}. Wenn Sie {stop} sehen, drfen Sie nicht reagieren.",
