            "faces.story.determination1": "This is a story about a woman who made it onto the Olympic rowing team. She is now in the race for the gold medal. Halfway through the race she is third, but gaining on second. Two thirds of the way through the race she sees that she is in position to pass the boat in first. She rows as fast as she ever has in her life.",
