            "faces.story.hope2": "This is a story of a woman who went to the horse races to bet five hundred dollars. She bet it all on horse number 7. For her to win, the horse has to finish first or second. She is now watching the horses make the final turn down the stretch to the finish line. Horse number 7 is in second place.",
            "faces.story.pain": "This is a story of a woman who has just had her ingrown toenail operated on. She is now waiting in line to see a movie. As another movie ends, the crowd is asked to step back to let them through. Someone accidentally steps on her toe.",
