            "faces.instructions": "Anda akan melihat foto-foto orang dengan berbagai ekspresi wajah. Pilih kata yang menurut Anda paling sesuai dengan perasaan orang itu.{break}{break}Beberapa foto akan disertai cerita singkat yang menjelaskan situasinya, dan Anda akan diberi {time} detik untuk menjawab. Foto lain akan disajikan tanpa informasi lain, dan Anda akan diberi waktu 7 detik untuk menjawab. {break}Pastikan Anda membaca setiap cerita secara tuntas: beberapa dari cerita mungkin terasa mirip, tetapi menuturkan kisah yang berbeda.",
            "faces.question.man": "Emosi apa yang dirasakan si laki-laki?",
            "faces.question.woman": "Emosi apa yang dirasakan si perempuan?",
            "faces.story.determination1": "Ini adalah cerita tentang seorang wanita yang berhasil masuk tim dayung Olimpiade. Dia saat ini sedang bertanding untuk memperebutkan medali emas. Di tengah perlombaan dia berada di posisi ketiga tetapi akan segera ke posisi kedua. Dua pertiga jalan, dia sadar bahwa dia dapat mendahului perahu di posisi pertama. Dia mendayung secepat mungkin, sekuat tenaganya.",
            "faces.story.determination2": "Ini adalah cerita tentang seorang laki-laki yang sudah berlatih sangat keras dan berhasil masuk tim dayung Olimpiade. Dia saat ini sedang bertanding untuk memperebutkan medali emas. Separuh jalan, dia berada di posisi pertama di antara lima perahu yang bertanding.",
            "faces.story.hope1": "Ini adalah cerita tentang seorang laki-laki yang pergi ke pacuan kuda untuk mempertaruhkan lima ratus dolar terakhir yang dia punya. Dia mempertaruhkan semuanya untuk kuda nomor 7. Dia sekarang menonton kuda-kuda yang bertanding melalui belokan terakhir menuju garis finis. Kuda nomor 9 dan kuda nomor 7 melaju bersamaan. Sepertinya kuda nomor 7 akan mendahuluinya.",
            "faces.story.hope2": "Ini adalah cerita tentang seorang perempuan yang pergi ke pacuan kuda untuk mempertaruhkan lima ratus dolar. Dia mempertaruhkan semuanya untuk kuda nomor 7. Agar dia menang, kuda itu harus finis pada posisi pertama atau kedua. Dia sekarang menonton kuda-kuda yang bertanding melalui belokan terakhir menuju garis finis. Kuda nomor 7 berada di posisi kedua.",
            "faces.story.pain": "Ini adalah cerita tentang seorang perempuan yang baru saja menjalani operasi pada kuku kakinya yang tumbuh ke dalam. Dia sekarang sedang mengantre untuk menonton sebuah film. Saat film sebelumnya selesai, para penontonnya diminta untuk mundur agar penonton berikutnya bisa masuk. Seseorang tidak sengaja menginjak jari kakinya itu.",
            "faces.story.pain2": "Ini adalah cerita tentang seorang laki-laki yang pergi ke bioskop untuk menonton sebuah film. Dia sekarang sedang mengantre untuk menonton film itu. Saat penonton dipersilakan masuk ke bioskop, sepasang orang masuk dengan kasar melalui kerumunan, mendorong laki-laki itu dan menginjak jari kakinya yang sedang memar.",
            "faces.story.puzzled": 'Ini adalah cerita tentang seorang laki-laki yang pergi ke McDonald\'s untuk pertama kalinya. Saat mengantre, dia melihat-lihat menu. Beberapa orang telah mendapatkan makanannya dan tanpa sadar dia berada di ujung antrean. Kasir berkata, "Mau pesan apa, Bapak?" Laki-laki itu melihat si kasir sejenak kemudian kembali memandangi menu.',
            "faces.story.puzzled2": 'Ini adalah cerita tentang seorang perempuan yang pergi ke McDonald\'s untuk makan siang. Setelah mengantre sejenak, tibalah gilirannya untuk memesan. Kasir berkata, "Mau pesan apa, Ibu?" Perempuan itu melihat si kasir sejenak kemudian kembali memandangi menu.',
