            "faces.question.man": "Che emozione sta provando questuomo?",
            "faces.question.woman": "Che emozione sta provando questa donna?",
            "faces.story.determination1": "Questa ? la storia di una donna che ? riuscita a entrare nella squadra olimpica di canottaggio. In questo momento sta gareggiando per la medaglia doro. A met? della gara ? terza, ma si sta avvicinando alla seconda. A due terzi della gara si rende conto di essere nella posizione giusta per tagliare il traguardo per prima. Spinge sui remi pi? forte che pu?.",
            "faces.story.determination2": "Questa ? la storia di un uomo che si ? allenato moltissimo, riuscendo a entrare nella squadra olimpica di canottaggio. In questo momento sta gareggiando per la medaglia doro. A met? della gara, a cui partecipano cinque barche, si trova al comando.",
            "faces.story.hope1": "Questa ? la storia di un uomo che ? andato a una corsa ippica per scommettere gli ultimi cinquecento dollari che gli sono rimasti. Ha puntato tutto sul cavallo numero 7. In questo momento sta guardando i cavalli mentre percorrono lultima curva prima del rettilineo finale. Il cavallo numero 9 e il cavallo numero 7 sono testa a testa. Sembra che il cavallo numero 7 stia per passare al comando.",
            "faces.story.hope2": "Questa ? la storia di una donna che ? andata a una corsa ippica per scommettere cinquecento dollari. Ha puntato tutto sul cavallo numero 7. Per vincere la scommessa, il cavallo deve classificarsi primo o secondo. In questo momento sta guardando i cavalli mentre percorrono lultima curva prima del rettilineo finale. Il cavallo numero 7 ? in seconda posizione.",
            "faces.story.pain": "Questa ? la storia di una donna che ha appena subito un intervento chirurgico allalluce per ununghia incarnita. In questo momento ? in coda al cinema, in attesa di entrare in sala. Poich ? appena terminato un altro spettacolo, il personale chiede di arretrare per lasciar passare le persone. Qualcuno le pesta il piede per sbaglio.",
            "faces.story.pain2": "Questa ? la storia di un uomo che ? andato a vedere un film al cinema. In questo momento sta aspettando in coda per entrare in sala. Non appena vengono aperte le porte, due individui maleducati si fanno largo tra la folla, urtando luomo e pestandogli lalluce, proprio dove qualche giorno prima si era procurato una ferita.",
            "faces.story.puzzled": 'Questa ? la storia di un uomo che va da McDonalds per la prima volta. Mentre aspetta il suo turno per ordinare, osserva il menu esposto in alto. Intanto tutte le persone che lo precedono vengono servite e, senza rendersene conto, arriva il suo turno. Il cassiere chiede: "Come posso aiutarla?". Luomo gli fa un cenno e torna a guardare il menu.',
            "faces.story.puzzled2": 'Questa ? la storia di una donna che ? andata a pranzo da McDonalds. Dopo una breve attesa, ? il suo turno di ordinare. Il cassiere chiede: "Come posso aiutarla?". La donna gli fa un cenno e torna a guardare il menu.',
