            "eyes.instructions": "Voor elke vraag krijgt u twee ogen te zien. U krijgt {time} seconden om aan te geven welk woord het best beschrijft wat de persoon in deze afbeelding denkt of voelt. Misschien denkt u dat er meer dan n woord van toepassing is, maar u mag slechts n woord kiezen, het woord dat volgens u het meest geschikt is.{break}{break}Zorg ervoor dat u alle 4 woorden hebt gelezen voordat u een keuze maakt.",
            "faces.answer.anger": "Woede",
            "faces.answer.determination": "Vastberadenheid",
            "faces.answer.disgust": "Afkeer",
            "faces.answer.fear": "Angst",
            "faces.answer.happiness": "Geluk",
            "faces.answer.hope": "Hoop",
            "faces.answer.pain": "Pijn",
            "faces.answer.puzzlement": "Verwarring",
            "faces.answer.sadness": "Droefheid",
            "faces.answer.surprise": "Verrassing",
            "faces.instructions": "U krijgt foto's te zien van mensen met verschillende uitdrukkingen op hun gezicht. Kies het woord dat volgens u het beste beschrijft wat die persoon voelt.{break}{break}Bij sommige foto's hoort een kort verhaal dat een situatie beschrijft. U hebt {time} seconden om te antwoorden. Andere foto's worden zonder commentaar getoond. U hebt 7 seconden om te antwoorden. {break}Lees elk verhaal helemaal door. Sommige verhalen lijken op elkaar, maar de inhoud verschilt.",
            "faces.question.man": "Welke emotie voelt de man?",
            "faces.question.woman": "Welke emotie voelt de vrouw?",
            "faces.story.determination1": "Dit is een verhaal over een vrouw die een plek in het Olympische roeiteam wist te bemachtigen. Ze dingt nu mee voor de gouden medaille. Halverwege de wedstrijd is ze derde, maar ze is bezig in te lopen op nummer twee. Op twee derde van het traject van de wedstrijd ziet ze dat ze in positie ligt om de eerste boot voorbij te steken. Ze roeit zo hard als ze nog nooit eerder in haar leven heeft geroeid.",
            "faces.story.determination2": "Dit is een verhaal over een man die een plek in het Olympische roeiteam wist te bemachtigen. Hij dingt nu mee voor de gouden medaille. Halverwege de wedstrijd waar vijf boten aan meedoen, ligt hij voorop.",
            "faces.story.hope1": "Dit is het verhaal van een man die naar de paardenrennen ging om zijn laatste vijfhonderd dollar te verwedden. Hij zette al zijn geld in op het paard met nummer 7. Nu kijkt hij hoe de paarden de laatste bocht ingaan om naar de eindmeet te racen. Het paard met nummer 9 en het paard met nummer 7 liggen nek aan nek. Het ziet ernaar uit dat het paard met nummer 7 de race zal winnen.",
            "faces.story.hope2": "Dit is het verhaal van een vrouw die naar de paardenrennen ging om vijfhonderd dollar te verwedden. Zij zette al het geld in op het paard met nummer 7. Het paard moet als eerste of tweede eindigen als ze wil winnen. Nu kijkt zij hoe de paarden de laatste bocht ingaan om naar de eindmeet te racen. Het paard met nummer 7 ligt op de tweede plaats.",
            "faces.story.pain": "Dit is het verhaal van een vrouw die kort geleden aan haar ingegroeide teennagel is geoperereerd. Ze staat nu in de rij te wachten om een film te zien. Wanneer de vorige film uit is, wordt de menigte gevraagd om achteruit te gaan zodat de anderen naar buiten kunnen komen. Iemand trapt per ongeluk op haar teen.",
            "faces.story.pain2": "Dit is het verhaal van een man die naar de bioscoop ging om een film te zien. Hij staat nu in de rij te wachten om de film te zien. Wanneer het publiek in de bioscoopzaal naar binnen mag, duwen een paar mensen zich ruw een weg door de menigte. Ze botsen op de man en trappen op zijn gekneusde teen.",
            "faces.story.puzzled": "Dit is het verhaal van een man die voor de eerste keer naar een McDonald's gaat. Terwijl hij in de rij staat te wachten, kijkt hij naar de menukaart. Er worden heel wat mensen bediend, en zonder dat hij er erg in heeft, staat hij ineens vooraan in de rij. De kassier vraagt: Wat zal het zijn? De man groet de kassier en richt zijn aandacht weer op de menukaart.",
            "faces.story.puzzled2": "Dit is het verhaal van een vrouw die naar McDonald's gaat om te lunchen. Ze moet even wachten in de rij en dan is het haar beurt om te bestellen. De kassier vraagt: Wat zal het zijn? De vrouw groet de kassier en richt haar aandacht weer op de menukaart.",
            "game.startPrompt": "Druk op Start als u {break} klaar bent om door te gaan.",
