            "gameSubmission.incompleteGameData": "Er heeft zich een probleem voor tijdens het verwerken van uw gamegegevens. Dit kan gebeuren als er niet genoeg reacties waren of als de verkeerde toets werd gebruikt om te reageren. Lees de instructies en probeer opnieuw.",
            "gameSubmission.noNetwork": "Waarschijnlijk is de verbinding van uw apparaat met onze server verloren gegaan.{break}We proberen 5 minuten om uw resultaten opnieuw te verzenden.{break}{break}Laat dit venster open, zodat de resultaten kunnen worden verzonden zodra er opnieuw verbinding is.",
