            "hiddenFigures.instructions2": "EEN van de eenvoudige vormen zit in het complexe patroon verborgen.{break}{break}{break}{trialCompleted}{shapesCompleted}{break}{break}{break}De volledige omtrek van de eenvoudige vorm zit in het {break}patroon, maar andere lijnen kunnen de vorm doorkruisen.{break}De vorm is niet gedraaid.",
            "hiddenFigures.instructions2.mobile": "EEN van de eenvoudige vormen zit in het complexe patroon verborgen.\\n\\n{{type:image,src:shapesExampleTrialComplete,height:100}}{{type:image,src:shapesExampleChoicesComplete,height:150}}\\n\\nDe volledige omtrek van de eenvoudige vorm zit in het patroon, maar andere lijnen kunnen de vorm doorkruisen. De vorm is niet gedraaid.",
