            "letters.instructions": "U krijgt een aantal letters een voor een te zien. Druk op de {spacebar} als de huidige letter op het scherm overeenkomt met de letter van twee frames terug.{break}{break}Als de sequentie bijvoorbeeld {letterSequence} is, dan moet u op de {spacebar} drukken als de tweede {blueF} op het scherm verschijnt, en ook als de tweede {redG} verschijnt. Doe niets voor alle andere letters.",
