            "eyes.instructions": "Przy kadym pytaniu zobaczysz par oczu. Masz {time} sek. na wskazanie, ktre sowo najlepiej opisuje to, co myli lub czuje osoba na zdjciu. Moesz myle, e do zdjcia pasuje wicej ni jedno sowo, ale naley wybra tylko jedno okrelenie, ktre wedug Ciebie jest najbardziej odpowiednie.{break}{break}Zanim dokonasz wyboru, upewnij si, e przeczytae(-a) wszystkie 4 opcje.",
