            "faces.answer.surprise": "Zaskoczenie",
            "faces.instructions": "Zobaczysz fotografie ludzi z rnymi wyrazami twarzy. Wybierz sowo, ktre wedug Ciebie najlepiej opisuje to, co czuje dana osoba.{break}{break}Wraz z niektrymi zdjciami zostan przedstawione krtkie historie opisujce jak sytuacj. W ich przypadku na odpowied bdziesz mie {time} sek. Inne zdjcia zostan wywietlone same. W ich przypadku na odpowied bdziesz mie 7 sekund. {break}Pamitaj o przeczytaniu kadej historii w caoci  niektre z nich mog wydawa si podobne, ale tak naprawd si od siebie rni.",
            "faces.question.man": "Jak emocj odczuwa ten mczyzna?",
            "faces.question.woman": "Jak emocj odczuwa ta kobieta?",
            "faces.story.determination1": "To historia kobiety, ktra dostaa si do olimpijskiej druyny wiolarskiej. Startuje w zawodach o zoty medal. W poowie wycigu zajmuje trzecie miejsce, ale z kad sekund jest coraz bliej. Po upywie dwch trzecich drogi zauwaa, e zaraz minie osob na pierwszym miejscu. Wiosuje szybciej ni kiedykolwiek.",
            "faces.story.determination2": "To historia mczyzny, ktry pracowa bardzo ciko i dosta si do olimpijskiej druyny wiolarskiej. Teraz startuje w zawodach o zoty medal. W poowie wycigu zajmuje pierwsze miejsce spord piciu odzi.",
            "faces.story.hope1": "To historia mczyzny, ktry uda si na wycigi konne, aby postawi swoje ostatnie 500 dolarw. Wszystko postawi na konia z numerem 7. Wanie obserwuje, jak konie pokonuj ostatni odcinek do mety. Ko z numerem 9 i ko z numerem 7 id eb w eb. Wyglda na to, e ko z numerem 7 obejmie prowadzenie.",
            "faces.story.hope2": "To historia kobiety, ktra udaa si na wycigi konne, aby postawi 500 dolarw. Wszystko postawia na konia z numerem 7. Wygra, jeli ko ukoczy wycig jako pierwszy lub jako drugi. Wanie obserwuje, jak konie wykonuj ostatni odcinek do mety. Ko z numerem 7 obejmuje drugie miejsce.",
            "faces.story.pain": "To historia kobiety, ktra wanie przesza zabieg na wrastajcy paznokie u stopy. Teraz czeka w kolejce do kina. Kiedy koczy si inny film, stojcy w kolejce zostaj poproszeni o cofnicie si, aby przepuci wychodzcych. Kto przypadkowo staje na jej palec u nogi.",
            "faces.story.pain2": "To historia mczyzny, ktry uda si do kina. Teraz czeka w kolejce, aby zobaczy film. Kiedy obsuga zaczyna wpuszcza ludzi do rodka, pewna para niegrzecznie przepycha si przez tum, wpadajc na mczyzn i stajc na jego stuczonym palcu u nogi.",
            "faces.story.puzzled": "To historia mczyzny, ktry po raz pierwszy idzie do restauracji McDonalds. Czekajc w kolejce, patrzy na menu. Kilka osb zostaje obsuonych, a on, nie zdajc sobie z tego sprawy, znajduje si na pocztku kolejki. Kasjerka mwi: W czym mog pomc?. Mczyzna zwraca uwag na kasjerk, a nastpnie znw skupia si na menu.",
            "faces.story.puzzled2": "To historia kobiety, ktra udaa si do restauracji McDonalds na lunch. Po krtkiej chwili czekania w kolejce przychodzi jej kolej na zoenie zamwienia. Kasjerka mwi: W czym mog pomc?. Kobieta zwraca uwag na kasjerk, a nastpnie znw skupia si na menu.",
