            "gameSubmission.noNetwork": "Zdaje si, e Twoje urzdzenie utracio poczenie z naszym serwerem.{break}Bdziemy prbowa ponownie przesa Twoje wyniki przez 5 minut.{break}{break}Nie zamykaj tego okna, aby wyniki mogy zosta przesane po ponownym ustanowieniu poczenia.",
